(45,'privacy_policy','<header class=\"tl_article_header\" dir=\"auto\" style=\"overflow-wrap: break-word; line-height: 1.58; padding: 0px; margin: 0px;\">\n  <p class=\"MsoNormal\" style=\"color: rgb(0, 0, 0); font-family: Calibri, sans-serif; font-size: 12pt; margin: 15.75pt 15.75pt 9pt; line-height: 25.5pt;\">\n    <b><span style=\"font-size: 24pt; font-family: \'Lucida Grande\', sans-serif;\">Политика конфиденциальности</span></b>\n  </p>\n  <p class=\"MsoNormal\" style=\"color: rgb(0, 0, 0); font-family: Calibri, sans-serif; font-size: 12pt; margin: 0cm 15.75pt 9pt;\">\n    <span style=\"font-size: 13.5pt; font-family: Georgia, serif;\">Веб-сайт: <a href=\"https://dmarket.kg/\" style=\"color: blue; text-decoration-line: underline;\">https://dmarket.kg/</a></span>\n  </p>\n  <p class=\"MsoNormal\" style=\"color: rgb(0, 0, 0); font-family: Calibri, sans-serif; font-size: 12pt; margin: 0cm 15.75pt 9pt;\">\n    <span style=\"font-size: 13.5pt; font-family: Georgia, serif;\">Дата вступления в силу: 17.05.2025</span>\n  </p>\n  <p class=\"MsoNormal\" style=\"color: rgb(0, 0, 0); font-family: Calibri, sans-serif; font-size: 12pt; margin: 13.5pt 15.75pt 6.75pt;\">\n    <b><span style=\"font-size: 21pt; font-family: \'Lucida Grande\', sans-serif;\">1. Введение</span></b>\n  </p>\n  <p class=\"MsoNormal\" style=\"color: rgb(0, 0, 0); font-family: Calibri, sans-serif; font-size: 12pt; margin: 0cm 15.75pt 9pt;\">\n    <span style=\"font-size: 13.5pt; font-family: Georgia, serif;\">Настоящая Политика конфиденциальности описывает, как OOO D-Market (далее – «Компания», «мы», «наш» или «нас») собирает, использует и защищает информацию, которую вы предоставляете нам, посещая наш веб-сайт https://dmarket.kg/ (далее – «Веб-сайт»).</span>\n  </p>\n  <p class=\"MsoNormal\" style=\"color: rgb(0, 0, 0); font-family: Calibri, sans-serif; font-size: 12pt; margin: 13.5pt 15.75pt 6.75pt;\">\n    <b><span style=\"font-size: 21pt; font-family: \'Lucida Grande\', sans-serif;\">2. Сбор информации</span></b>\n  </p>\n  <p class=\"MsoNormal\" style=\"color: rgb(0, 0, 0); font-family: Calibri, sans-serif; font-size: 12pt; margin: 0cm 15.75pt 9pt;\">\n    <span style=\"font-size: 13.5pt; font-family: Georgia, serif;\">Мы собираем личные данные, которые вы предоставляете добровольно при регистрации, создании учетной записи, использовании Веб-сайта, а также при заполнении форм или обращении в нашу службу поддержки. Собранная информация может включать, но не ограничивается, следующими данными:</span>\n  </p>\n  <p class=\"MsoNormal\" style=\"color: rgb(0, 0, 0); font-family: Calibri, sans-serif; font-size: 12pt; margin: 0cm 15.75pt 10.5pt 74.25pt; text-indent: -18pt;\">\n    <span style=\"font-size: 13.5pt; font-family: Georgia, serif;\">· Имя и контактные данные (электронная почта, номер телефона)</span>\n  </p>\n  <p class=\"MsoNormal\" style=\"color: rgb(0, 0, 0); font-family: Calibri, sans-serif; font-size: 12pt; margin: 0cm 15.75pt 10.5pt 74.25pt; text-indent: -18pt;\">\n    <span style=\"font-size: 13.5pt; font-family: Georgia, serif;\">· Информация о вашем устройстве и интернет-подключении</span>\n  </p>\n  <p class=\"MsoNormal\" style=\"color: rgb(0, 0, 0); font-family: Calibri, sans-serif; font-size: 12pt; margin: 0cm 15.75pt 10.5pt 74.25pt; text-indent: -18pt;\">\n    <span style=\"font-size: 13.5pt; font-family: Georgia, serif;\">· Данные о ваших действиях на Веб-сайте</span>\n  </p>\n  <p class=\"MsoNormal\" style=\"color: rgb(0, 0, 0); font-family: Calibri, sans-serif; font-size: 12pt; margin: 13.5pt 15.75pt 6.75pt;\">\n    <b><span style=\"font-size: 21pt; font-family: \'Lucida Grande\', sans-serif;\">3. Использование информации</span></b>\n  </p>\n  <p class=\"MsoNormal\" style=\"color: rgb(0, 0, 0); font-family: Calibri, sans-serif; font-size: 12pt; margin: 0cm 15.75pt 9pt;\">\n    <span style=\"font-size: 13.5pt; font-family: Georgia, serif;\">Собранная информация используется для следующих целей:</span>\n  </p>\n  <p class=\"MsoNormal\" style=\"color: rgb(0, 0, 0); font-family: Calibri, sans-serif; font-size: 12pt; margin: 0cm 15.75pt 10.5pt 74.25pt; text-indent: -18pt;\">\n    <span style=\"font-size: 13.5pt; font-family: Georgia, serif;\">· Обеспечение работы Веб-сайта и улучшение качества его обслуживания</span>\n  </p>\n  <p class=\"MsoNormal\" style=\"color: rgb(0, 0, 0); font-family: Calibri, sans-serif; font-size: 12pt; margin: 0cm 15.75pt 10.5pt 74.25pt; text-indent: -18pt;\">\n    <span style=\"font-size: 13.5pt; font-family: Georgia, serif;\">· Обработка регистраций и управление вашей учетной записью</span>\n  </p>\n  <p class=\"MsoNormal\" style=\"color: rgb(0, 0, 0); font-family: Calibri, sans-serif; font-size: 12pt; margin: 0cm 15.75pt 10.5pt 74.25pt; text-indent: -18pt;\">\n    <span style=\"font-size: 13.5pt; font-family: Georgia, serif;\">· Предоставление персонализированных услуг и улучшение вашего опыта использования Веб-сайта</span>\n  </p>\n  <p class=\"MsoNormal\" style=\"color: rgb(0, 0, 0); font-family: Calibri, sans-serif; font-size: 12pt; margin: 0cm 15.75pt 10.5pt 74.25pt; text-indent: -18pt;\">\n    <span style=\"font-size: 13.5pt; font-family: Georgia, serif;\">· Ответы на ваши запросы и поддержка пользователей</span>\n  </p>\n  <p class=\"MsoNormal\" style=\"color: rgb(0, 0, 0); font-family: Calibri, sans-serif; font-size: 12pt; margin: 13.5pt 15.75pt 6.75pt;\">\n    <b><span style=\"font-size: 21pt; font-family: \'Lucida Grande\', sans-serif;\">4. Передача данных третьим лицам</span></b>\n  </p>\n  <p class=\"MsoNormal\" style=\"color: rgb(0, 0, 0); font-family: Calibri, sans-serif; font-size: 12pt; margin: 0cm 15.75pt 9pt;\">\n    <span style=\"font-size: 13.5pt; font-family: Georgia, serif;\">Мы не передаем ваши личные данные третьим лицам без вашего согласия, за исключением случаев, предусмотренных законом, или если это необходимо для предоставления наших услуг.</span>\n  </p>\n  <p class=\"MsoNormal\" style=\"color: rgb(0, 0, 0); font-family: Calibri, sans-serif; font-s